         <h3>A fun quiz of 10 questions. </h3>
         <h3>Test your knowledge on various categories!</h3>
         <button className='btn-start' onClick={() => props.setStarted(true)}>Start quiz</button>
         <div className="blobtwo"></div>
    </div>
    )
}
